import React, {Fragment} from "react";
import ForumsList from './ForumsList.js'


class Forums extends React.Component {
  constructor(props){
    super(props)
  }

  componentDidMount(){
    fetch('http://localhost:3000/api/v1/forums')
    .then(r => r.json())
    .then(this.setState({allForums: r}))
  }


  render(){
    return("hi")
  }

}
export default Forums
